import React from "react";
import ProductCard from "../components/ProductCard";

function Shop() {
  const products = [
    { id: 1, title: "Diamond Earrings", price: 300, image: "https://via.placeholder.com/200" },
    { id: 2, title: "Gold Bangle", price: 450, image: "https://via.placeholder.com/200" },
    { id: 3, title: "Platinum Ring", price: 600, image: "https://via.placeholder.com/200" },
  ];

  return (
    <div>
      <h2 className="mb-4">Shop Jewellery</h2>
      <div className="row g-4">
        {products.map((p) => (
          <div className="col-md-4" key={p.id}>
            <ProductCard {...p} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Shop;
